      backgroundColor: color,
      height: height,
      width: width,
      opacity: opacity,
      position: position,
      top: top,
      right: right
    }}
  ></div>
);

const Titre = ({ color, bgcolor, opacity, fontSize }) => (
  <div
    style={{
      color: color,
      backgroundColor: bgcolor,
      opacity: opacity,
      fontSize: fontSize
    }}
  ></div>
);

