          sed arcu non odio euismod. Velit ut tortor pretium viverra
          suspendisse. Lacus vestibulum sed arcu non odio euismod.
        </p>

        <button>Contact Us</button>

        <BarreDore
          color='#5A4D10'
          height='295px'
          width='32px'
          opacity='0.2'
          position='absolute'
          top='736px'
          right='0'
        />
      </div>
    );
  }
}

export default Home;
